import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import Card from "./Card";
class Home extends React.Component {
  state = {
    cards: [{ id: 1, cardValue: "XB" }, { id: 2, cardValue: "HC" }]
  };
  handle = () => {
    const cards = this.state.cards;
    cards.push({ id: 3, cardValue: "BA" });
    this.setState(cards);
  };
  render() {
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "80vh"
        }}
      >
        {this.state.cards.map(card => (
          <Card key={card.id} cardValue={card.cardValue} selected={true} />
        ))}
        <Fab size="large" aria-label="Add" onClick={this.handle}>
          <AddIcon />
        </Fab>
      </div>
    );
  }
}
export default Home;
